type PropsType = {
    question: string,
    answer: Array<string>,
    callback: any,
    userAnswer: string,
    questionNm: number,
    totalQuestions: number
}

const QuestionCard: React.FC<PropsType> = ({
                                               question,
                                               answer,
                                               callback,
                                               userAnswer,
                                               questionNm,
                                               totalQuestions
                                           }) => {
    return (
        <div>
            <p className="number">
                Question: {questionNm}
            </p>
        </div>
    )
}

export default QuestionCard;
